import Layout from '../components/MyLayout';
import Link from 'next/link';
import './index.scss';
import displyImage from '../images/gatsbyadd.jpg'




export default function Index() {
  return (

      <Layout>

        <h1>Welcome !</h1>
<style jsx>{`
  h1,
  {
    font-family: 'Arial';
    color: #46634e;
  }
  <div>
    <img src='displyImage' alt='display' id='displyImage' />
  </div>


  `}</style>
      </Layout>





  );


}
































